import { parseCookies, setCookie } from 'nookies'


const getCookies = () => {

    setCookie(null, 'fromClient', 'value', {
        maxAge: 30 * 24 * 60 * 60,
        path: '/',
      })

    const cookies = parseCookies();

    console.log(cookies);

}


export default {
    getCookies
}
